Назначение
IP АТС Т76-С предназначена для предоставления услуг телефонной связи и передачи данных между подразделениями организаций и ведомств в сетях с пакетной коммутацией в условиях экономичного использования выделенных или арендованных ресурсов связи.

IP АТС Т76-С обладает следующими техническими характеристиками:
- поддерживаемые интерфейсы в зависимости от установленных блоков FXS, FXO и E1P-2: 
- интерфейсы FXS (0, 24 или 48 аналоговых телефонных каналов); 
- интерфейсы FXО (0, 24 или 48 аналоговых телефонных каналов); 
- интерфейсы Е1 (G.703) с сигнализацией EDSS-1 (0, 2, 4 или 6 каналов); 
- 2 интерфейса Ethernet 100 Base-T; 
- протоколы IP телефонии SIP, IAX2;
- линейные алгоритмы сжатия, кодеки G.711, G.726, GSM; 
- подавление пауз и эхоподавление при передаче голосового трафика согласно алгоритма mg2ec с длиной буфера для сигналов не менее, чем 64 мс; 
- качество передачи голоса не менее, чем 3 балла по шкале MOS; 
- поддержка не менее 40 одновременных разговоров; 
- локальное управление с использованием консоли стоечного исполнения; 
- электропитание: диапазон входного напряжения: 187-240 В, 50 Гц, максимальная потребляемая мощность: не более 200 Вт; 
- габариты: 482,6 × 88,1 × 452,6 мм.

