Порядок действий при работе с IP АТС Т76-С
Включение изделия
1) включить IP АТС Т76-С, нажав выключатель питания, находящейся на задней панели изделия; 
2) включить консоль управления; 
3) установить идентификатор Touch Memory администратора АПМДЗ в коннектор Touch Memory; 
4) ввести пароль администратора АПМДЗ при появлении запроса. Пароль администратора "PASSWORD"; 
5) произойдет вход в систему IP АТС Т76-С и на экране консоли управле-ния появится приглашение для входа в СУиМ; 
6) авторизоваться в СуиМ с правами администратора системы, для этого: 
1. Не убирая электронный ключ, нажать клавишу Enter и ввести имя пользователя; 
2. Перевести курсор в строку ввода пароля, нажать клавишу Enter; 
3. Ввести пароль; 
4. Перевести курсор в поле Вход и нажать клавишу Enter.
7) при необходимости выполнить загрузку отредактированного конфигурационного файла IP АТС Т76-С (с внесенными изменениями) в соответствии с указаниями приведенными ниже, перезагрузить IP АТС Т76-С, чтобы изменения вступили в силу, и далее пройти идентификацию/аутентификацию в АПМДЗ, авторизоваться в СуиМ с правами администратора системы или оператора; 
8) удалить идентификатор Touch Memory администратора АПМДЗ из коннектора Touch Memory.

Редактирование и загрузка конфигурационного файла
IP АТС Т76-С поставляется с загруженным конфигурационным файлом. 
Если в конфигурацию IP АТС Т76-С требуется внести изменения параметров, то необходимо выполнить следующие действия: 
1) на персональном компьютере (ПК) отредактировать в текстовом редакторе (в редакторе "Notepad++") конфигурационный файл, поставляемый на USB Flash; 
2) записать обновленный конфигурационный файл на USB Flash накопи-тель; 
3) вставить USB Flash накопитель в USB разъем изделия; 
4) войти в СуиМ с правами администратора системы; 
5) зарегистрировать в СуиМ USB Flash накопитель. для этого: 
Зарегистрировать внешний носитель USB Flash может только пользователь с правами администратора. 
Необходимо выполнить следующие действия: 
1. В основном окне СУиМ выбрать пункт меню Меню / Доб. флешку. В окне регистрации отобразится список USB флеш-дисков, зарегистрированных в системе; 
2. Выбрать пункт меню Добавить (функциональная клавиша F4); 
3. Подключить к разъему USB на корпусе устройства внешний носитель USB Flash; 
4. После подсвечивания поля Есть нажать клавишу Enter. Появится сообщение о регистрации флеш-диска; 

6) загрузить обновленный конфигурационный файл, для этого необходимо выполнить последовательность действий: 
1. В основном окне СУиМ выбрать пункт Меню / Управление / Загр. конф.; 
2. Вставить USB Flash в USB-разъем и выбрать пункт Монтир. в области меню (функциональная клавиша F3). 
USB Flash будет смонтирован, появится информационная надпись «Флеш-диск смонтирован. После окончания работы нажмите Отмонт.»;
3. Перейти при помощи клавиш управления курсором в поле Выбор файла конфигурации, нажать клавишу Enter. Появится окно загрузки конфигурации. 
В верхней части окна рабочей области отобразится список конфигурационных файлов для загрузки, содержащихся на внешнем носителе USB Flash, в нижней части окна - содержимое выбранного файла; 
4. Выбрать необходимый файл в рабочей области окна, используя клавиши управления курсором, нажать клавишу Enter. 
При необходимости допускается редактирование выбранного файла. Переход в нижнюю часть окна осуществляется клавишами управления курсором; 
5. После внесения изменений файл конфигурации необходимо сохранить (функциональная клавиша F4); 
6. В появившемся окне для подтверждения выбрать Есть (если изменения сохранять не требуется - выбрать Отставить); 
7. Принять решение о загрузке этого файла (функциональная клавиша F5). Произойдет загрузка конфигурационного файла; 
8. Выполнить размонтирование носителя, выбрав в области меню пункт Отмонт. (функциональная клавиша F3); 
9. Извлечь USB Flash из USB-разъема; 
10. Для возврата в основное меню выбрать пункт Меню. 
ВНИМАНИЕ! Загрузка конфигурационного файла в изделие проводится в СУИМ только администратором системы. 
7) удалить накопитель USB Flash из USB-разъема включенного изделия; 
8) перезагрузить изделие, чтобы новые настройки вступили в силу, для этого: 
1. Выбрать пункт Перезаг. (функциональная клавиша F4) в основном окне СУиМ; 
2. Появится окно подтверждения «Перезагрузить систему?»; 
3. Выбрать Есть и нажать клавишу Enter. Произойдет перезагрузка СУиМ.
